module.exports = "Index,Text\r\n1,Old forms.\r\n2,Alternate forms.\r\n3,\"The original forms of ferrem and ferre are fer-sm and fer-se, respectively.\"\r\n4,Gerundive (Future Passive Participle)\r\n5,singular\r\n6,\"The verbs nl and mal are compounds of volo. They therefore attach n- or m- to the beginning of each verb, in place of vo- or vu-. Exceptions to this are found in the present tense: nl nlumus ml mlumus nn vs nn vultis mvs mvultis nn vult nlunt mvult mlunt In addition, nl is the only verb of the three that has present and future tense imperative forms of the verb: nl, nlte, and nlt, nltte, respectively.\"\r\n7,An earlier form.\r\n8,\"The perfect passive participle ending will change according to its subject's gender, number and case. Endings shown here are the masculine, feminine and neuter nominative singular.\"\r\n9,A passive form of the verb that is used impersonally is itum est.\r\n10,\"While the perfect form of this verb is regular, ii usually contracts to i when it is followed by an s. Thus, st, stis and sse\"\r\n11,It is rare that the v appear as a form.\r\n12,Used by early writers."

